  \"\",\n\t\t\"description\": \"This data set provides supply chain health commodity
  shipment and pricing data. Specifically, the data set identifies Antiretroviral
  (ARV) and HIV lab shipments to supported countries. In addition, the data set provides
  the commodity pricing and associated supply chain expenses necessary to move the
  commodities to countries for use.  The dataset has similar fields to the Global
  Fund's Price, Quality and Reporting (PQR) data.  PEPFAR and the Global Fund represent
  the two largest procurers of HIV health commodities.  This dataset, when analyzed
  in conjunction with the PQR data, provides a more complete picture of global spending
  on specific health commodities. The data are particularly valuable for understanding
  ranges and trends in pricing as well as volumes delivered by country.  The US Government
  believes this data will help stakeholders make better, data-driven decisions.  Care
  should be taken to consider contextual factors when using the database.  Conclusions
  related to costs associated with moving specific line items or products to specific
  countries and lead times by product/country will not be accurate.\",\n\t\t\"format\":
